import React, {Component} from 'react';

class Header extends Component {
    render() {
        return (
            <header className="App-header">
                <p className="title">
                    IntelliHealth 
                </p>
                <p className="sub-title">
                    Diabetes Recommendation Platform
                </p>
            </header>
        );
    }
}
export default Header;
